function filterTable(b,e){dehighlight(e);var d=b.value.toLowerCase().split(" ");for(var c=0;c<e.children.length;c++){var f="";for(var a=0;a<d.length;a++){if(e.children[c].innerHTML.replace(/<[^>]+>/g,"").toLowerCase().indexOf(d[a])<0){f="none"}else{if(d[a].length){highlight(d[a],e.children[c])}}e.children[c].style.display=f}}}function dehighlight(a){for(var b=0;b<a.childNodes.length;b++){var c=a.childNodes[b];if(c.attributes&&c.attributes["class"]&&c.attributes["class"].value=="highlighted"){c.parentNode.parentNode.replaceChild(document.createTextNode(c.parentNode.innerHTML.replace(/<[^>]+>/g,"")),c.parentNode);return}else{if(c.nodeType!=3){dehighlight(c)}}}}function highlight(e,c){for(var d=0;d<c.childNodes.length;d++){var f=c.childNodes[d];if(f.nodeType==3){var g=f.data;var b=g.toLowerCase();if(b.indexOf(e)>=0){var h=document.createElement("span");f.parentNode.replaceChild(h,f);var a;while((a=b.indexOf(e))!=-1){h.appendChild(document.createTextNode(g.substr(0,a)));h.appendChild(create_node(document.createTextNode(g.substr(a,e.length))));g=g.substr(a+e.length);b=b.substr(a+e.length)}h.appendChild(document.createTextNode(g))}}else{highlight(e,f)}}}function create_node(b){var a=document.createElement("span");a.setAttribute("class","highlighted");a.attributes["class"].value="highlighted";a.appendChild(b);return a};